var _notes_ = {
    "1406": [
        {
            "Title": "v5 ",
            "DescList": [
                "• Before, Cipher's True DMG can trigger Remembrance Trailblazer's True DMG, and can be recorded by E1 Tribbie and converted to 24% True DMG. This will no longer happen.",
                "• Before, Cipher's equally distributed True DMG will attack dead targets (but the DMG number is calculated with alive targets), so Cipher will deal 300% of the original DMG when hitting 1 alive and 2 dead targets. This will no longer happen."
            ]
        },
        {
            "Title": "v4 E6: Recorded DMG +400%, records 180% DMG",
            "DescList": [
                "Cipher C6 \"recorded DMG increases by @48%#\" is added to the Base Record Value (12%). That is, the actual recorded amount is @5 times# the amount without C6.",
                "Counting the effects of E1 and Trace 1, with E6, Cipher records @180%# of her follow-up attack DMG. (36% without E6)"
            ]
        },
        {
            "Title": "Cipher's Paradox",
            "DescList": [
                "Sometimes Cipher's Ult deals more DMG aiming the adjacent unit than aiming the central unit.",
                "Ult first deals 25% True DMG to the central target, then deals 75% True DMG equally distributed among the central and adjacent targets.",
                "Suppose there is a Boss with 2 minions, and the minions have @low HP# (like AS Hoolay)",
                "• Aim the Boss, and the Boss takes @25% + 75%÷3 = 50%# True DMG.",
                "• Aim an adjacent minion, and the first 25% True DMG kills it. Now the central target is dead, and the only alive adjacent target is the Boss. Therefore @all 75% True DMG# of the second hit is distributed to the Boss. More DMG than aiming the Boss itself!"
            ]
        }
    ]
}

